import React from 'react';

type InfoboxProps = {
    Title: string;
    Description: string;
    Image?: string;
};

const Infobox: React.FC<InfoboxProps> = ({ Title, Description, Image }) => {
    return (
        <div>
            <h1>{Title}</h1>
            <p>{Description}</p>
            {Image && <img src={Image} alt="Infobox Image" />}
        </div>
    );
};

export default Infobox;
